import React from "react";
import Photo from './javascript.png'
const Body = () =>{
    return(
        <div className="px-10">
        <h4 className="text-black m-4">More Recents</h4>
        <div className="flex justify-center">
            <div className="h-5">
            <h5 className="font-bold">Revolutiozing retail banking: how fintech is transforming the industry</h5>
            <p>lorem ipsum dolor sit amet de la si por favour</p>
            </div>
            <div className="h-5"><img src={Photo} alt="photo"/></div>
        </div>
        </div>
    )
}

export default Body;
